"use strict";(self.webpackChunkdev_shipperhq=self.webpackChunkdev_shipperhq||[]).push([[8032],{8213:function(i){i.exports=JSON.parse('{"name":"insight","permalink":"/docs/tags/insight","docs":[{"id":"insight/how-shipping-insights-works","title":"How Shipping Insights Works","description":"ShipperHQ generates a significant amount of detail about each shipment for which it creates shipping rates and options each time an application calls the Rating API. Once the ShipperHQ account associated with the rating call has the Shipping Insights Advanced Feature enabled, ShipperHQ stores these shipment details for later retrieval with the Shipping Insights API.","permalink":"/docs/insight/how-shipping-insights-works"},{"id":"insight/place-order","title":"PlaceOrder Mutation","description":"How Rating + Shipping Insights Works with the PlaceOrder mutation","permalink":"/docs/insight/place-order"},{"id":"insight/faq","title":"Shipping Insights FAQ","description":"Is the data for past orders available via the Shipping Insights API?","permalink":"/docs/insight/faq"},{"id":"insight/overview","title":"Shipping Insights Overview","description":"There are many elements that impact both the shipping rates and options offered to eCommerce customers at checkout as well as how orders are fulfilled. For example, what carrier and service to use, what package or packages to use, what warehouse to ship from, etc. When ShipperHQ is used to produce shipping rates and options, it will determine many of these elements as part of its rating calculations. The Shipping Insights API gives you access to all of those details that can be used in a variety of scenarios including automating fulfillment.","permalink":"/docs/insight/overview"},{"id":"insight/quickstart","title":"Shipping Insights Quickstart","description":"This document is intended for technical architects and developers that need to integrate with ShipperHQ\u2019s Shipping Insights API to build their own integration to retrieve shipment details from ShipperHQ.","permalink":"/docs/insight/quickstart"}],"allTagsPath":"/docs/tags"}')}}]);